import React from 'react';

const ContactsList = ({contacts}) => {

    console.log(contacts);
    return (
        <div>
            contacts list
            <ol>
                {contacts.map(contact => (
                  <li>
                    {contact.name}
                    </li>  
                ))}
            </ol>
<table>
  <tr>
    <th>id</th>
    <th>Contact</th>
    <th>Number</th>
  </tr>
{contacts.map(contact => (
    <tr>
    <td>{contact.id}</td>
    <td>{contact.name}</td>
    <td>{contact.number}</td>
  </tr>
))}
</table>
        </div>
    );
};

export default ContactsList;
